import React from "react"
import './Index.css'
import FundoMP4 from '../Videos/fundo_home.mp4'

export default function Home(){

    return(
        <section className='home-container'>

            <video src={FundoMP4} width="320" height="240" controls autoplay/>

        </section>
    )
}
